import React,{Component} from 'react'
class MainConten extends Component{
	render(){
		return(
            <div className="main-contend">
              <img src="https://xwatch.vn/upload_images/images/2019/10/07/phu-kien-dong-ho-xwatch.jpg" alt=""/>
             <i>PHU KIỆN ĐỒNG HỒ CHÍNH HÃNG: Dây da, hộp xoay, hộp da đựng đồng hồ ĐẸP - BỀN - CHẤT</i>
             <div className="contend">
                <i>Dây đeo đồng hồ đa dạng chất liệu: Dây da bò, dây da cá sấu, dây đà điểu với đường bo viền chắc chắn, đường may đều mang lại vẻ đẹp thẩm mĩ và sức bền cho dây đeo.</i>
                <i>Hộp da đựng đồng hồ cầm tay 2 ngăn với 2 màu sang trọng: Đen và Nâu - Tiện lợi khi mang theo du lịch.</i>
                <i>Hộp xoay đồng hồ với chất liệu vỏ là gỗ sơn mài bóng cùng nội thất bọc da PU màu sữa sang trọng, mềm mại tạo nên vẻ đẹp trang nhã và thanh lịch.</i>
             </div>
             <i>Hãy tân trang và chăm sóc cỗ máy thời gian của mình bằng những phụ kiện đồng hồ chính hãng, bền đẹp nhé!</i>
          </div>
        
      
)
}
}
export default MainConten;
